CREATE TABLE cliente (
  ID_cliente INT PRIMARY KEY ,
  nome_completo VARCHAR(50) NOT NULL,
  CPF CHAR(11) NOT NULL UNIQUE,
  data_nascimento DATE,
  telefone VARCHAR(20),
  idade INT,
  email VARCHAR(100)
);

PESQUISAS

SELECT * FROM cliente;
SELECT * FROM cliente WHERE cpf = '91753339016'
SELECT * FROM cliente WHERE idade > 50;
SELECT * FROM cliente;
SELECT * FROM cliente WHERE id_cliente=501;
